Create table applicants (
id		integer,
email	varchar(50),
status	varchar(50),
bankruptcy_flg	bool,
bad_email_flg	bool,
fraud_flg	bool,
first_name	varchar(50),
created_at	timestamp,
updated_at	timestamp,
PRIMARY KEY (id)
);


create table products (
id	integer,
applicant_id	integer, 
status	varchar(50),
amount_cents	integer,
term	integer,
funding_date	date,
state	varchar(50),
apr_percentage	numeric,
created_at	timestamp,
updated_at 	timestamp, 
customer_application_id 	integer,
due_date	date,
PRIMARY KEY (id),
FOREIGN KEY (applicant_id) REFERENCES applicants (id)
);




create table Transaction_Tasks
(
id 	int, 
product_id	int,
parent_transaction_task_id	int,
eff_date	date,
type	varchar,
status	varchar,
created_at	timestamp,
updated_at	timestamp
PRIMARY KEY (id)
);


create table Transaction_details	
(
id 	int,
transaction_task_id	int,
amount_cents	numeric,
debit_account	varchar,
credit_account	varchar,
eff_date	date,
created_at	timestamp,
updated_at	timestamp,
PRIMARY KEY (id)
)


